(4, 1, 1, 1, 1, 0, 0, '1.1.1.01', 'Pajak Kendaraan Bermotor (PKB)', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari PKB mobil penumpang-sedan, PKB-mobil penumpang-jeep, PKB-mobil penumpang-minibus, PKB-mobil bus-microbus, PKB-mobil bus-bus, PKB-mobil barang/beban-pick up, PKB- mobil barang/beban-light truck, PKB-mobil barang/beban-truck, PKB-mobil barang/beban-blind van, PKB-sepeda motor-sepeda motor roda dua, PKB-sepeda motor- sepeda motor roda tiga, PKB-kendaraan bermotor yang dioperasikan di air, PKB- kendaraan khusus alat berat/alat besar, dan PKB-mobil roda tiga.', 'nabiila', '2024-02-17 05:08:13'),
(5, 1, 1, 1, 2, 0, 0, '1.1.1.02', 'Bea Balik Nama Kendaraan Bermotor (BBNKB)', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari BBNKB-mobil penumpang-sedan, BBNKB-mobil penumpang-jeep, BBNKB-mobil penumpang-minibus, BBNKB-mobil bus-microbus, BBNKB-mobil bus-bus, BBNKB- mobil barang/beban-pick up, BBNKB-mobil barang/beban-light truck, BBNKB-mobil barang/beban-truck, BBNKB-mobil barang/beban-blind van, BBNKB-sepeda motor- sepeda motor roda dua, BBNKB-sepeda motor-sepeda motor roda tiga, BBNKB- kendaraan bermotor yang dioperasikan di air, BBNKB-kendaraan khusus alat berat, dan BBNKB-mobil roda tiga.', 'nabiila', '2024-02-17 05:08:13'),
(6, 1, 1, 1, 3, 0, 0, '1.1.1.03', 'Pajak Bahan Bakar Kendaraan Bermotor (PBBKB)', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari PBBKB-bahan bakar bensin, PBBKB-bahan bakar solar, PBBKB-bahan bakar gas, dan PBBKB-bahan bakar lainnya.', 'nabiila', '2024-02-17 05:08:13'),
(7, 1, 1, 1, 4, 0, 0, '1.1.1.04', 'Pajak Air Permukaan', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari pajak air permukaan.', 'nabiila', '2024-02-17 05:08:13'),
