(9, 1, 1, 1, 6, 0, 0, '1.1.1.06', 'Pajak Hotel', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari pajak hotel, pajak motel, pajak losmen, pajak gubuk pariwisata, pajak wisma pariwisata, pajak pesanggrahan, pajak rumah penginapan dan sejenisnya, serta pajak rumah kos dengan jumlah kamar lebih dari 10 (sepuluh).', 'nabiila', '2024-02-17 05:08:13'),
(10, 1, 1, 1, 7, 0, 0, '1.1.1.07', 'Pajak Restoran', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari pajak restoran dan sejenisnya, pajak rumah makan dan sejenisnya, pajak kafetaria dan sejenisnya, pajak kantin dan sejenisnya, pajak warung dan sejenisnya, pajak bar dan sejenisnya, serta pajak jasa boga/katering dan sejenisnya.', 'nabiila', '2024-02-17 05:08:13'),
