(16, 1, 1, 1, 13, 0, 0, '1.1.1.13', 'Pajak Sarang Burung Walet', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari pajak sarang burung walet.', 'nabiila', '2024-02-17 05:08:13'),
(17, 1, 1, 1, 14, 0, 0, '1.1.1.14', 'Pajak Mineral Bukan Logam dan Batuan', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari pajak asbes, pajak batu tulis, pajak batu setengah permata, pajak batu kapur, pajak batu apung, pajak batu permata, pajak bentonit, pajak dolomit, pajak felspar, pajak garam batu (halite), pajak grafit, pajak granit/andesit, pajak gips, pajak kalsit, pajak kaolin, pajak leusit, pajak magnesit, pajak mika, pajak marmer, pajak nitrat, pajak opsidien, pajak oker, pajak pasir dan kerikil, pajak pasir kuarsa, pajak perlit, pajak phospat, pajak talk, pajak tanah serap (fullers earth), pajak tanah diatome, pajak tanah liat, pajak tawas (alum), pajak tras, pajak yarosif, pajak zeolit, pajak basal, pajak trakit, dan pajak mineral bukan logam dan batuan lainnya.', 'nabiila', '2024-02-17 05:08:13'),
(18, 1, 1, 1, 15, 0, 0, '1.1.1.15', 'Pajak Bumi dan Bangunan Pedesaan dan Perkotaan', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari pajak bumi dan bangunan perdesaan dan perkotaan.', 'nabiila', '2024-02-17 05:08:13'),
(19, 1, 1, 1, 16, 0, 0, '1.1.1.16', 'Bea Perolehan Hak Atas Tanah dan Bangunan (BPHTB)', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari BPHTB-pemindahan hak dan BPHTB-pemberian hak baru.', 'nabiila', '2024-02-17 05:08:13'),
