(21, 1, 1, 2, 1, 0, 0, '1.1.2.01', 'Retribusi Jasa Umum', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari retribusi pelayanan kesehatan, retribusi pelayanan persampahan/kebersihan, retribusi pelayanan pemakaman dan pengabuan mayat, retribusi pelayanan parkir di tepi jalan umum, retribusi pelayanan pasar, retribusi pengujian kendaraan bermotor, retribusi pemeriksaan alat pemadam kebakaran, retribusi penggantian biaya cetak peta, retribusi penyediaan dan/atau penyedotan kakus, retribusi pengolahan limbah cair, retribusi pelayanan tera/tera ulang, retribusi pelayanan pendidikan, serta retribusi pengawasan dan pengendalian menara telekomunikasi.', 'nabiila', '2024-02-17 05:08:13'),
(22, 1, 1, 2, 2, 0, 0, '1.1.2.02', 'Retribusi Jasa Usaha', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari retribusi pemakaian kekayaan daerah, retribusi pasar grosir dan/atau pertokoan, retribusi penyediaan tempat pelelangan, retribusi terminal, retribusi tempat khusus parkir, retribusi tempat penginapan/pesanggrahan/ vila, retribusi rumah potong hewan, retribusi pelayanan kepelabuhan, retribusi tempat rekreasi dan olahraga, retribusi penyeberangan air, dan retribusi penjualan produksi usaha daerah.', 'nabiila', '2024-02-17 05:08:13'),
(23, 1, 1, 2, 3, 0, 0, '1.1.2.03', 'Retribusi Perizinan Tertentu', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari retribusi izin mendirikan bangunan, retribusi izin tempat penjualan minuman beralkohol, retribusi izin trayek untuk menyediakan pelayanan angkutan umum, retribusi izin usaha perikanan, retribusi pengendalian lalu lintas, retribusi perpanjangan Izin Mempekerjakan Tenaga Kerja Asing (IMTA), retribusi persetujuan bangunan gedung, retribusi penggunaan tenaga kerja asing, dan retribusi pertambangan rakyat.', 'nabiila', '2024-02-17 05:08:13'),
