(25, 1, 1, 3, 1, 0, 0, '1.1.3.01', 'Bagian Laba yang Dibagikan kepada Pemerintah Daerah (Dividen) atas Penyertaan Modal pada Perusahaan Milik Pemerintah/BUMN', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari bagian laba yang dibagikan kepada pemerintah daerah (dividen) atas penyertaan modal pada perusahaan milik pemerintah/BUMN.', 'nabiila', '2024-02-17 05:08:13'),
(26, 1, 1, 3, 2, 0, 0, '1.1.3.02', 'Bagian Laba yang Dibagikan kepada Pemerintah Daerah (Dividen) atas Penyertaan Modal pada Perusahaan Milik Daerah/BUMD', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari bagian laba yang dibagikan kepada pemerintah daerah (dividen) atas penyertaan modal pada perusahaan milik daerah/BUMD.', 'nabiila', '2024-02-17 05:08:13'),
(27, 1, 1, 3, 3, 0, 0, '1.1.3.03', 'Bagian Laba yang dibagikan kepada Pemerintah Daerah (Dividen) atas Penyertaan Modal pada Perusahaan Milik Swasta', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari bagian laba yang dibagikan kepada pemerintah daerah (dividen) atas penyertaan modal pada perusahaan milik swasta.', 'nabiila', '2024-02-17 05:08:13'),
(28, 1, 1, 4, 0, 0, 0, '1.1.4', 'Lain-lain PAD Yang Sah', '4', 0, NULL, '', 'nabiila', '2024-02-17 05:08:13'),
