(30, 1, 1, 4, 2, 0, 0, '1.1.4.02', 'Hasil Selisih Lebih Tukar Menukar BMD yang Tidak Dipisahkan', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari hasil selisih lebih tukar menukar tanah, hasil selisih lebih tukar menukar peralatan dan mesin, hasil selisih lebih tukar menukar gedung dan bangunan, hasil selisih lebih tukar menukar jalan, jaringan dan irigasi, hasil selisih lebih tukar menukar aset tetap lainnya, serta hasil selisih lebih tukar menukar aset lainnya-aset tak berwujud.', 'nabiila', '2024-02-17 05:08:13'),
(31, 1, 1, 4, 3, 0, 0, '1.1.4.03', 'Hasil Pemanfaatan BMD yang Tidak Dipisahkan', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari hasil sewa BMD, hasil kerja sama pemanfaatan BMD, hasil dari bangun guna serah, hasil dari bangun serah guna, dan hasil dari kerja sama penyediaan infrastruktur.', 'nabiila', '2024-02-17 05:08:13'),
