(34, 1, 1, 4, 6, 0, 0, '1.1.4.06', 'Hasil Pengelolaan Dana Bergulir', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari hasil pengelolaan dana bergulir.', 'nabiila', '2024-02-17 05:08:13'),
