(46, 1, 1, 4, 18, 0, 0, '1.1.4.18', 'Pendapatan Dana Kapitasi JKN pada FKTP', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari pendapatan dana Kapitasi JKN pada FKTP.', 'nabiila', '2024-02-17 05:08:13'),
