(58, 1, 2, 1, 3, 1, 1, '1.2.1.03.01.01', 'Dana Otonomi Khusus-Provinsi Papua-Umum', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari Dana Otonomi Khusus-Provinsi Papua-Umum yang penerimaannya bersifat umum setara dengan 1% (satu persen) dari plafon Dana Alokasi Umum nasional yang ditujukan untuk mendanai: a. pembangunan, pemeliharaan, dan pelaksanaan pelayanan publik; b. peningkatan kesejahteraan Orang Asli Papua dan penguatan lembaga adat; dan c. hal lain berdasarkan kebutuhan dan prioritas daerah sesuai dengan ketentuan peraturan perundang undangan.', 'nabiila', '2024-02-17 05:08:13'),
