(247, 2, 2, 1, 3, 0, 0, '2.2.1.03', 'Dana Otonomi Khusus dan Dana Tambahan Otonomi Khusus/Dana Tambahan Infrastruktur', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari dana otonomi khusus-Provinsi Papua, dana otonomi khusus-Provinsi Papua Barat, dana otonomi khusus-Provinsi Aceh, dana tambahan infrastruktur dalam rangka otonomi khusus Provinsi Papua, dan dana tambahan infrastruktur dalam rangka otonomi khusus Provinsi Papua Barat.', 'nabiila', '2024-02-17 05:08:13'),
