(249, 2, 2, 1, 3, 1, 1, '2.2.1.03.01.01', 'Dana Otonomi Khusus Dana Urusan Bersama', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari dana otonomi khusus dana urusan bersama.', 'nabiila', '2024-02-17 05:08:13'),
(250, 2, 2, 1, 3, 1, 2, '2.2.1.03.01.02', 'Dana Otonomi Khusus Kabupaten/Kota pada Provinsi Papua', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari dana otonomi khusus kabupaten/kota pada Provinsi Papua.', 'nabiila', '2024-02-17 05:08:13'),
(251, 2, 2, 1, 3, 1, 3, '2.2.1.03.01.03', 'Dana Otonomi Khusus Provinsi Papua', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari dana otonomi khusus Provinsi Papua.', 'nabiila', '2024-02-17 05:08:13'),
(252, 2, 2, 1, 3, 1, 4, '2.2.1.03.01.04', 'Dana Otonomi Khusus-Provinsi Papua-Khusus', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari Dana Otonomi Khusus-Provinsi Papua-Khusus yang penerimaannya telah ditentukan penggunaannya dengan berbasis kinerja pelaksanaan sebesar 1,25% (satu koma dua lima persen) dari plafon Dana Alokasi Umum nasional yang ditujukan untuk pendanaan pendidikan, kesehatan, dan pemberdayaan ekonomi masyarakat, dengan besaran paling sedikit: a. 30% (tiga puluh persen) untuk belanja pendidikan; b. 20% (dua puluh persen) untuk belanja kesehatan; c. Pemberdayaan Ekonomi Masyarakat.', 'nabiila', '2024-02-17 05:08:13'),
(253, 2, 2, 1, 3, 1, 5, '2.2.1.03.01.05', 'Dana Otonomi Khusus-Kabupaten/Kota pada Provinsi Papua-Khusus', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari Dana Otonomi Khusus-Kabupaten/Kota pada Provinsi Papua-Khusus yang penerimaannya telah ditentukan penggunaannya dengan berbasis kinerja pelaksanaan sebesar 1,25% (satu koma dua lima persen) dari plafon Dana Alokasi Umum nasional yang ditujukan untuk pendanaan pendidikan, kesehatan, dan pemberdayaan ekonomi masyarakat, dengan besaran paling sedikit: a. 30% (tiga puluh persen) untuk belanja pendidikan; b. 20% (dua puluh persen) untuk belanja kesehatan; c. Pemberdayaan Ekonomi Masyarakat.', 'nabiila', '2024-02-17 05:08:13'),
(254, 2, 2, 1, 3, 2, 0, '2.2.1.03.02', 'Dana Tambahan Otonomi Khusus/Dana Tambahan Infrastruktur Provinsi Papua', '4', 0, NULL, '', 'nabiila', '2024-02-17 05:08:13'),
(255, 2, 2, 1, 3, 2, 1, '2.2.1.03.02.01', 'Dana Tambahan Otonomi Khusus/Dana Tambahan Infrastruktur Provinsi Papua', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari Dana Tambahan Otonomi Khusus/Dana Tambahan Infrastruktur Provinsi Papua, yang digunakan untuk: a. pendanaan Pembangunan Infrastruktur Perhubungan Provinsi Dan Lintas Kabupaten/Kota; b. pembangunan, perluasan dan/atau rehabilitasi ketersediaan air bersih khususnya di daerah terdepan tertinggal dan terluar; c. pembangunan, perluasan dan/atau rehabilitasi ketersediaan energi listrik khususnya di daerah terdepan tertinggal dan terluar; d. fasilitasi, pembangunan, perluasan dan/atau rehabilitasi jaringan telekomunikasi khususnya di daerah terdepan tertinggal dan terluar; dan e. paling tinggi 5% (lima persen) untuk mendanai kegiatan penunjang yang berhubungan langsung dengan kegiatan pembangunan yang didanai dari Dana Tambahan Infrastruktur Papua untuk tahun berkenaan.', 'nabiila', '2024-02-17 05:08:13'),
(256, 2, 2, 1, 3, 2, 2, '2.2.1.03.02.02', 'Dana Tambahan Otonomi Khusus/Dana Tambahan Infrastruktur Kabupaten/Kota Papua', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari dana tambahan otonomi khusus/dana tambahan infrastruktur Kabupaten/Kota Papua, yang digunakan untuk: a. pendanaan Pembangunan Infrastruktur Perhubungan di Kabupaten/Kota; b. pembangunan, perluasan dan/atau rehabilitasi ketersediaan air bersih khususnya di daerah terdepan tertinggal dan terluar; c. pembangunan, perluasan dan/atau rehabilitasi ketersediaan energi listrik khususnya di daerah terdepan tertinggal dan terluar; d. fasilitasi, pembangunan, perluasan dan/atau rehabilitasi jaringan telekomunikasi khususnya di daerah terdepan tertinggal dan terluar; e. pembangunan, perluasan dan/atau rehabilitasi sanitasi lingkungan penduduk Orang Asli Papua khususnya di daerah terdepan tertinggal dan terluar; dan f. paling tinggi 5% (lima persen) untuk mendanai kegiatan penunjang yang berhubungan langsung dengan kegiatan pembangunan yang didanai dari Dana Tambahan Infrastruktur Papua untuk tahun berkenaan.', 'nabiila', '2024-02-17 05:08:13'),
