(264, 2, 2, 1, 3, 4, 1, '2.2.1.03.04.01', 'Dana Tambahan Otonomi Khusus/Dana Tambahan Infrastruktur Provinsi Papua Barat', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari Dana Tambahan Otonomi Khusus/Dana Tambahan Infrastruktur Provinsi Papua Barat, yang digunakan untuk: a. pendanaan Pembangunan Infrastruktur Perhubungan Provinsi Dan Lintas Kabupaten/Kota; b. pembangunan, perluasan dan/atau rehabilitasi ketersediaan air bersih khususnya di daerah terdepan tertinggal dan terluar; c. pembangunan, perluasan dan/atau rehabilitasi ketersediaan energi listrik khususnya di daerah terdepan tertinggal dan terluar; d. fasilitasi, pembangunan, perluasan dan/atau rehabilitasi jaringan telekomunikasi khususnya di daerah terdepan tertinggal dan terluar; dan e. paling tinggi 5% (lima persen) untuk mendanai kegiatan penunjang yang berhubungan langsung dengan kegiatan pembangunan yang didanai dari Dana Tambahan Infrastruktur Papua untuk tahun berkenaan.', 'nabiila', '2024-02-17 05:08:13'),
(265, 2, 2, 1, 3, 4, 2, '2.2.1.03.04.02', 'Dana Tambahan Otonomi Khusus/Dana Tambahan Infrastruktur Kabupaten/Kota Papua Barat', '4', 0, NULL, 'Digunakan untuk mencatat belanja/pengeluaran pembiayaan yang bersumber dari dana tambahan otonomi khusus/dana tambahan infrastruktur Kabupaten/Kota Papua Barat, yang digunakan untuk: a. pendanaan Pembangunan Infrastruktur Perhubungan di Kabuaten/Kota; b. pembangunan, perluasan dan/atau rehabilitasi ketersediaan air bersih khususnya di daerah terdepan tertinggal dan terluar; c. pembangunan, perluasan dan/atau rehabilitasi ketersediaan energi listrik khususnya di daerah terdepan tertinggal dan terluar; d. fasilitasi, pembangunan, perluasan dan/atau rehabilitasi jaringan telekomunikasi khususnya di daerah terdepan tertinggal dan terluar; e. pembangunan, perluasan dan/atau rehabilitasi sanitasi lingkungan penduduk Orang Asli Papua khususnya di daerah terdepan tertinggal dan terluar; dan f. paling tinggi 5% (lima persen) untuk mendanai kegiatan penunjang yang berhubungan langsung dengan kegiatan pembangunan yang didanai dari Dana Tambahan Infrastruktur Papua untuk tahun berkenaan.', 'nabiila', '2024-02-17 05:08:13'),
